import React from "react";
import {
  BrowserRouter,
  Switch,
  Route,
  Link,
  useParams,
} from "react-router-dom";

import Header from "./Header";
import Cats from "./Cats";
import Dogs from "./Dogs";
import "./App.css";

function Main() {
  return (
    <BrowserRouter>
      <div className="main">
        <ul>
          <li>
            <Link to="/cats"></Link>
          </li>
          <li>
            <Link to="/dogs"></Link>
          </li>
        </ul>
        <Header />
        <Switch>
          <Route path="/:id" children={<Child />} />
        </Switch>
      </div>
    </BrowserRouter>
  );
}
function Child() {
  let { id } = useParams();

  function capitalize(str) {
    const capitalized = str[0].toUpperCase() + str.slice(1);
    return capitalized;
  }

  const name = capitalize(id);

  return { name };
}
export default Main;
